        /// <summary>
        /// https://leetcode.com/problems/longest-substring-without-repeating-characters/
        /// </summary>
        [Fact]
        public void longest_substring_without_repeating_characters()
        {
            int lengthOfLongestSubstring(string s)
            {
                //pv4k method
                //var set = new Dictionary<char, int>();
                //int longest = 0;
                //for (int i = 0; i < s.Length; i++)
                //{
                //    if (set.ContainsKey(s[i]))
                //    {
                //        if (set.Count > longest)
                //        {
                //            longest = set.Count;
                //        }
                //        i = set[s[i]] + 1;
                //        set = new Dictionary<char, int>();
                //    }
                //    set.Add(s[i], i);
                //}
                //return Math.Max(set.Count, longest);

                //my method
                int maxCount = 0;

                for (int i = 0; i < s.Length; i++)
                {
                    for (int j = i + 1; j <= s.Length; j++)
                    {
                        if (i == j)
                            continue;

                        int startIndex = i < j ? i : j;
                        int endIndex = i > j ? i : j;

                        var substring = s.Substring(startIndex, endIndex - startIndex);
                        int substringUniqueChars = substring.Distinct().Count();

                        var stringIsUnique = (substring.Length == substringUniqueChars);

                        if (!stringIsUnique)
                            break;

                        if (maxCount < substringUniqueChars)
                        {
                            maxCount = substringUniqueChars;

                            if (maxCount == 95)
                                return maxCount;
                        }
                    }
                }

                return maxCount;
            }

            Assert.Equal(3, lengthOfLongestSubstring("abcabcbb"));
            Assert.Equal(1, lengthOfLongestSubstring("bbb"));
            Assert.Equal(3, lengthOfLongestSubstring("pwwkew"));
            Assert.Equal(0, lengthOfLongestSubstring(""));
            Assert.Equal(1, lengthOfLongestSubstring(" "));
            Assert.Equal(7, lengthOfLongestSubstring("vbxpvwkkteaiob"));
            Assert.Equal(12, lengthOfLongestSubstring("xqgatvlevdqugapmlgymhkdgjthnqflpvtpqodujingqnvcyeamlmruvndkfivufokvcpqoxfunsrptvshhgzbcogotpknuyz"));
