        /// <summary>
        /// https://leetcode.com/problems/subarrays-with-k-different-integers/
        /// </summary>
        [Fact]
        public void subarrays_with_k_different_integers()
        {
            int SubarraysWithKDistinct(int[] nums, int k)
            {
                int differentSubarrays = 0;
                List<int> subarrInts = new List<int>(k);

                for (int i = 0, j = 0, c = nums.Count(); i < c && j < c;)
                {
                    if (!subarrInts.Contains(nums[j]))
                        subarrInts.Add(nums[j]);

                    if (subarrInts.Count > k)
                    {
                        subarrInts.Clear();
                        i++;
                        j = i;
                    }
                    else
                    {
                        if (subarrInts.Count == k)
                            differentSubarrays++;

                        j++;
                    }
                    if (j == c)
                    {
                        i++;
                        j = i;
                        subarrInts.Clear();
                    }
                }

                return differentSubarrays;
            }
            //Debug.WriteLine($"{i}, {j} - {differentSubarrays} - {String.Join(' ', nums[i..j])}");

            Assert.Equal(7, SubarraysWithKDistinct(new int[] { 1, 2, 1, 2, 3 }, 2));
            Assert.Equal(3, SubarraysWithKDistinct(new int[] { 1, 2, 1, 3, 4 }, 3));
            Assert.Equal(10, SubarraysWithKDistinct(new int[] { 2, 1, 2, 1, 2 }, 2));
        }

        /// <summary>
        /// https://leetcode.com/problems/lru-cache/
        /// Runtime: 816 ms, faster than 87.40% of C# online submissions for LRU Cache.
        /// Memory Usage: 137.4 MB, less than 17.77% of C# online submissions for LRU Cache.
        /// </summary>
        class LRUCache
        {
            private Dictionary<int, int> _cache { get; set;  }
            private int _capacity {  get; set; }
            private List<int> _indexes {  get; set; }

            public LRUCache(int capacity)
            {
                _capacity = capacity;
                _indexes = new List<int>(capacity);
                _cache = new Dictionary<int, int>(capacity);
            }

            public int Get(int key)
            {
                bool isExists = _cache.TryGetValue(key, out int resultValue);

                if (isExists)
                {
                    _indexes.Remove(key);
                    _indexes.Insert(0, key);
                }
                else
                {
                    resultValue = -1;
                }

                return resultValue;
            }

            public void Put(int key, int value)
            {
                // Put new item
                if (!_cache.ContainsKey(key))
                {
                    _cache.Add(key, value);

                    _indexes.Insert(0, key);
                    if (_indexes.Count > _capacity)
                    {
                        // get last item key
                        int keyToRemove = _indexes.Last();

                        _indexes.RemoveAt(_capacity);
                        _cache.Remove(keyToRemove);
                    }
                }
                else
                // Update item
                {
                    _cache[key] = value;
                    
                    _indexes.Remove(key);
                    _indexes.Insert(0, key);
                }
            }
        }

        [Fact]
        public void LRU_Cache()
        {
            LRUCache lRUCache = new LRUCache(2);
            
            lRUCache.Put(1, 1); // cache is {1=1}
            lRUCache.Put(2, 2); // cache is {1=1, 2=2}

            Assert.Equal(1, lRUCache.Get(1));

            lRUCache.Put(3, 3); // LRU key was 2, evicts key 2, cache is {1=1, 3=3}

            Assert.Equal(-1, lRUCache.Get(2));

            lRUCache.Put(4, 4); // LRU key was 1, evicts key 1, cache is {4=4, 3=3}
            Assert.Equal(-1, lRUCache.Get(1));
            Assert.Equal(3, lRUCache.Get(3));
            Assert.Equal(4, lRUCache.Get(4));

            // ============================================================================
            lRUCache = new LRUCache(2);

            lRUCache.Put(1, 0); 
            lRUCache.Put(2, 2);

            Assert.Equal(0, lRUCache.Get(1));

            lRUCache.Put(3, 3);

            Assert.Equal(-1, lRUCache.Get(2));

            lRUCache.Put(4, 4);

            Assert.Equal(-1, lRUCache.Get(1));
            Assert.Equal(3, lRUCache.Get(3));
            Assert.Equal(4, lRUCache.Get(4));

            // ============================================================================
            lRUCache = new LRUCache(2);

            lRUCache.Put(2, 2);
            lRUCache.Put(2, 1);
        }
    }
